import React, { Component } from "react";

type Props = {};

const Services: React.FC<Props> = ({}) => {
  return (
    <>
      <div class="container-fluid">
        <h1>
          Consulta <small>Facturas</small>
        </h1>
        <div class="row">
          <TableFilters />
          <div class="col-10">
            <div class="container-fluid">
              <div class="table-responsive">
                <CustomTable />
              </div>
            </div>

            <div class="container">
              <center>
                <TablePaginator />
              </center>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Services;
